import React from 'react';
import './index.css';

class Header extends React.Component {
    render() {
        return (
            <main>
            <div className="container">
              <header className="header">
                <a href="#">BOLG</a>
              </header>
            </div>
          </main>
        )
    }
}

export default Header;
